import './styles.css';
import React from 'react'
import range from 'lodash/range'
import * as selectors from '../../reducers'
import { connect } from 'react-redux';

const Baby = ({babies,count}) => (
    <div className="container">
        <div className="baby">
        {console.log(babies[0][Object.keys(babies[0])[1]]+babies[0][Object.keys(babies[0])[2]])}
        <select id="B" name="babies" options={babies.map(baby=>baby[Object.keys(baby)[1]]+baby[Object.keys(baby)[2]])}>
        </select>
        </div>
    </div>
)

export default connect(
    state => ({
        babies: selectors.getAllBabies(state)
    }),
    undefined
)(Baby)
